import React from 'react';
import './Homepage.css';

export default function Homepage() {

    return (
        <div className="homepage-container">
            <div className="panel" >
                <div className="left panel">
                    Left Panel
                </div>
                <div className="right panel">
                    Right Panel
                </div>
            </div>
        </div>
    )
}
